        //             </div>

        //             {/* <div className="email">
        //                 <label className="form__label" for="email">Email </label>
        //                 <input  type="email" id="email" className="form__input" placeholder="Email"/>
        //             </div> */}
        //             <div className="">
        //                 <input className="register-password" type="password"  id="password" placeholder="Create Password"/>
        //             </div>
        //             {/* <div className="confirm-password">
        //                 <label className="form__label" for="confirmPassword">Confirm Password </label>
        //                 <input className="form__input" type="password" id="confirmPassword" placeholder="Confirm Password"/>
        //             </div> */}
        //      </div>
        //  </div>

        <div class="register-wrapper">
            <h2 className="register-title">Sign up for a free account</h2>
            <form className="register-form" action="#">
              <div class="register-input-box">
                <input className="register-input" type="text" placeholder="Enter your name" required/>
              </div>
              <div class="register-input-box">
                <input className="register-input" type="text" placeholder="Enter your email" required/>
              </div>
              <div class="register-input-box">
                <input className="login-input" type="password" placeholder="Create password" required/>
              </div>
              <div class="login-input-box">
                <input className="login-input" type="password" placeholder="Confirm password" required/>
              </div>
              <div class="login-policy">
                <input className="login-input" type="checkbox"/>
                <h3 className="login-header">I accept all terms & condition</h3>
              </div>
              <div class="login-input-box login-button">
                <input className="login-input " id="login-input-button" type="Submit" value="Register Now"/>
              </div>
              <div class="login-text">
                <h3 className="login-header">Already have an account? <a className="login-link" href="#">Login now</a></h3>
              </div>
            </form>
          </div>
        );
    }
}

export default RegisterBody;
